import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the '+ New Event' button to navigate to the create page
    await page.waitForSelector('a.nav-link.create-btn');
    await page.click('a.nav-link.create-btn');

    // Wait for the new page to load
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_navigation.png'));

    return {
      success: true,
      action: "Navigated to the Create Event page",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

